import "./UserList.module.css";
import UserItem from "./UserItem";
import React from "react";

const UserList = (props) => {
  return (
    <Card>
      <ul>
        {props.users.map((user) => (
          <UserItem>
            {user.name} ({user.age} years old)
          </UserItem>
        ))}
      </ul>
    </Card>
  );
};

export default UserList;
